eval("module.exports = {\n  \"content\": [\n    \"article\",\n    {\n\n    },\n    [\n      \"h2\",\n      \"设计师专属\"\n    ],\n    [\n      \"p\",\n      \"安装 \",\n      [\n        \"a\",\n        {\n          \"title\": null,\n          \"href\": \"https://kitchen.alipay.com\"\n        },\n        \"Kitchen Sketch 插件 💎\"\n      ],\n      \"，可以一键拖拽使用 Ant Design 和 Iconfont 的海量图标，还可以关联自有项目。\"\n    ],\n    [\n      \"h2\",\n      \"设计原则\"\n    ],\n    [\n      \"p\",\n      \"Ant Design 的图标设计原则源自\\\"确定\\\"和\\\"自然\\\"，落实到图标设计领域，一共有四个，他们分别为：\"\n    ],\n    [\n      \"ul\",\n      [\n        \"li\",\n        [\n          \"p\",\n          [\n            \"strong\",\n            \"准确：\"\n          ],\n          \" 设计造型准确的图标（保持偶数原则，去小数点）；选择表意准确的图标，不对用户的认知造成困扰。\"\n        ]\n      ],\n      [\n        \"li\",\n        [\n          \"p\",\n          [\n            \"strong\",\n            \"简单：\"\n          ],\n          \" 在表意清晰准确的基础上，尽量保持图形的简洁，不做多余的修饰。\"\n        ]\n      ],\n      [\n        \"li\",\n        [\n          \"p\",\n          [\n            \"strong\",\n            \"节奏：\"\n          ],\n          \" 挖掘构图中的秩序之美。\"\n        ]\n      ],\n      [\n        \"li\",\n        [\n          \"p\",\n          [\n            \"strong\",\n            \"愉悦：\"\n          ],\n          \" 赋予适度的情感。\"\n        ]\n      ]\n    ],\n    [\n      \"h2\",\n      \"设计规格\"\n    ],\n    [\n      \"ul\",\n      [\n        \"li\",\n        [\n          \"p\",\n          [\n            \"strong\",\n            \"Artboard：\"\n          ],\n          \" Ant Design 的系统图标都是按照 1024 x 1024 的画板进行制作的：\"\n        ]\n      ]\n    ],\n    [\n      \"div\",\n      [\n        \"img\",\n        {\n          \"class\": \"preview-img no-padding\",\n          \"src\": \"https://gw.alipayobjects.com/zos/rmsportal/mrrFTiCWOyCsVOgAIBqg.png\",\n          \"alt\": \"设计规格\"\n        }\n      ]\n    ],\n    [\n      \"ul\",\n      [\n        \"li\",\n        [\n          \"p\",\n          [\n            \"strong\",\n            \"出血位：\"\n          ],\n          \" 在图标的设计过程中预留出血位的做法，可以预防某些造型的图标在具体应用时出现边缘被切掉的风险；同时在设计过程中，也为设计师把握图标间平衡留下了进退的余地。新版的设计规格在图形的外围预留了 64px 的出血位，多数的图标在设计中我们都不建议超过这个区域。\"\n        ]\n      ]\n    ],\n    [\n      \"div\",\n      [\n        \"img\",\n        {\n          \"class\": \"preview-img no-padding\",\n          \"src\": \"https://gw.alipayobjects.com/zos/rmsportal/FNXMpWnyvYfydiSnPCYg.png\",\n          \"alt\": \"出血位\"\n        }\n      ]\n    ],\n    [\n      \"h2\",\n      \"分层\"\n    ],\n    [\n      \"p\",\n      \"Ant Design 的图标设计对于设计稿的分层也有一定的要求，其目的除了让设计师实现有序的文档管理之外，更多的是便于团队间文档的传递，统一的设计框架像是无形的共识，可以让彼此间的理解得到进一步的提升。\"\n    ],\n    [\n      \"div\",\n      [\n        \"img\",\n        {\n          \"class\": \"preview-img no-padding\",\n          \"src\": \"https://gw.alipayobjects.com/zos/rmsportal/bVtUZqDRbGuaoVbwYqua.png\",\n          \"alt\": \"分层\"\n        }\n      ]\n    ],\n    [\n      \"h2\",\n      \"轮廓线与模版\"\n    ],\n    [\n      \"p\",\n      \"我们对设计模版进行了优化，根据出血位的尺寸，调整轮廓线的宽高，同时增加两个等边三角形和一个圆，这些都是图标设计中最常用的基本形式，设计师可以快速的调用并在此基础上做变形。\"\n    ],\n    [\n      \"div\",\n      [\n        \"img\",\n        {\n          \"class\": \"preview-img no-padding\",\n          \"src\": \"https://gw.alipayobjects.com/zos/rmsportal/ycDkLxfAqjnRsWZuHvik.png\",\n          \"alt\": \"轮廓线与模版\"\n        }\n      ]\n    ],\n    [\n      \"h2\",\n      \"图标设计指引\"\n    ],\n    [\n      \"p\",\n      \"根据\\\"确定性\\\"和\\\"自然\\\"的价值观，当构图含义明确之后，图标设计所追求的便是秩序之美。Ant Design 的图标主要通过四方面去实现\\\"秩序美\\\"，分别是：形式、韵律、平衡以及辨识。\"\n    ],\n    [\n      \"h3\",\n      \"1、形式\"\n    ],\n    [\n      \"p\",\n      \"形式，是构成一个图形最初始的结构。Ant Design 整套基础图标基本上都是由圆、方、三角这样的图形演变而成的。追求图形初始结构的理性，而非直觉式的设计，是秩序之美的第一步。\"\n    ],\n    [\n      \"div\",\n      [\n        \"img\",\n        {\n          \"class\": \"preview-img no-padding\",\n          \"src\": \"https://gw.alipayobjects.com/zos/rmsportal/HpESYoDACMTUWLEqtBRb.png\",\n          \"alt\": \"形式\"\n        }\n      ]\n    ],\n    [\n      \"h3\",\n      \"2、韵律\"\n    ],\n    [\n      \"p\",\n      \"Ant Design 图标的韵律感通过两个方面来体现：元素的韵律和构图的韵律。系统图标中最常见的元素基本上可以归纳称为：点、线、圆角、三角。\"\n    ],\n    [\n      \"h4\",\n      \"2-1. 元素的韵律\"\n    ],\n    [\n      \"ul\",\n      [\n        \"li\",\n        [\n          \"p\",\n          [\n            \"strong\",\n            \"点：\"\n          ],\n          \" 点是很多图形中都会出现的元素。Ant Design 会在一套图标中挖掘同一元素的规律，同时对其进行克制的运用。我们对于点的尺寸选择上会保持 16 的倍数这一原则。比如，在点的选择中，新版的图标最常用的是四种尺寸的点，分别为 80、96、112、128。当出现特殊尺寸的需求时，会按照 16 的倍数进行延展。\"\n        ]\n      ]\n    ],\n    [\n      \"div\",\n      [\n        \"img\",\n        {\n          \"class\": \"preview-img no-padding\",\n          \"src\": \"https://gw.alipayobjects.com/zos/rmsportal/qOHVVNiWAiQoHRjkuntb.png\",\n          \"alt\": \"点\"\n        }\n      ]\n    ],\n    [\n      \"ul\",\n      [\n        \"li\",\n        [\n          \"p\",\n          [\n            \"strong\",\n            \"线：\"\n          ],\n          \" 线条也是非常通用的元素之一。新版图标在线条之间的关系采用 8 倍数原则，从小到大以 8 的规律递增。常用的规格也是 4 种，分别为 56、64、72、80。\"\n        ]\n      ]\n    ],\n    [\n      \"div\",\n      [\n        \"img\",\n        {\n          \"class\": \"preview-img no-padding\",\n          \"src\": \"https://gw.alipayobjects.com/zos/rmsportal/WqaPFOssksoRsfSEMYgc.png\",\n          \"alt\": \"线\"\n        }\n      ]\n    ],\n    [\n      \"ul\",\n      [\n        \"li\",\n        [\n          \"p\",\n          [\n            \"strong\",\n            \"圆角：\"\n          ],\n          \" 圆角的规格采取的也是 8 倍数原则，最常用的是 3 种，分别是 8，16、32，它们之间是两倍数的关系。而图标内部空间的圆角则保持直角的处理方式。\"\n        ]\n      ]\n    ],\n    [\n      \"div\",\n      [\n        \"img\",\n        {\n          \"class\": \"preview-img no-padding\",\n          \"src\": \"https://gw.alipayobjects.com/zos/rmsportal/EycXTskdagLPlYMTvfdC.png\",\n          \"alt\": \"圆角\"\n        }\n      ]\n    ],\n    [\n      \"ul\",\n      [\n        \"li\",\n        [\n          \"p\",\n          [\n            \"strong\",\n            \"三角：\"\n          ],\n          \" 新版图标的角度受到美式战斗机 F-14 tomcat 的启发，将常用的角度定在约 76 度。在日常设计中，多数系统图标的角度都可以从 76 度这个数值出发，根据实际情况进行灵活的应用。\"\n        ]\n      ]\n    ],\n    [\n      \"div\",\n      [\n        \"img\",\n        {\n          \"class\": \"preview-img no-padding\",\n          \"src\": \"https://gw.alipayobjects.com/zos/rmsportal/WWnwBEQKIOhIeqbsIHZe.png\",\n          \"alt\": \"三角\"\n        }\n      ]\n    ],\n    [\n      \"p\",\n      \"除了定义角度，我们对新图标中实心箭头的规格也做了收敛，在顶角大约保持 76 度的基础上，最常用的为 4 种，他们的宽度保持 8 倍数的原则，间隔为 24 ：\"\n    ],\n    [\n      \"div\",\n      [\n        \"img\",\n        {\n          \"class\": \"preview-img no-padding\",\n          \"src\": \"https://gw.alipayobjects.com/zos/rmsportal/jOZvfCdFTfpFxSkJwiMF.png\",\n          \"alt\": \"实心箭头\"\n        }\n      ]\n    ],\n    [\n      \"p\",\n      \"基本元素在使用上的规格可以用下面的表格来总结，建议设计师在一套图标的设计中尽量保持克制的态度。\"\n    ],\n    [\n      \"table\",\n      [\n        \"thead\",\n        [\n          \"tr\",\n          [\n            \"th\",\n            \"点\"\n          ],\n          [\n            \"th\",\n            \"线\"\n          ],\n          [\n            \"th\",\n            \"圆角\"\n          ],\n          [\n            \"th\",\n            \"三角\"\n          ]\n        ]\n      ],\n      [\n        \"tbody\",\n        [\n          \"tr\",\n          [\n            \"td\",\n            \"...\"\n          ],\n          [\n            \"td\",\n            \"...\"\n          ],\n          [\n            \"td\",\n            \"/\"\n          ],\n          [\n            \"td\",\n            \"...\"\n          ]\n        ],\n        [\n          \"tr\",\n          [\n            \"td\",\n            \"80\"\n          ],\n          [\n            \"td\",\n            \"56\"\n          ],\n          [\n            \"td\",\n            \"8\"\n          ],\n          [\n            \"td\",\n            \"144\"\n          ]\n        ],\n        [\n          \"tr\",\n          [\n            \"td\",\n            \"96\"\n          ],\n          [\n            \"td\",\n            \"64\"\n          ],\n          [\n            \"td\",\n            \"16\"\n          ],\n          [\n            \"td\",\n            \"216\"\n          ]\n        ],\n        [\n          \"tr\",\n          [\n            \"td\",\n            \"112\"\n          ],\n          [\n            \"td\",\n            \"72\"\n          ],\n          [\n            \"td\",\n            \"32\"\n          ],\n          [\n            \"td\",\n            \"240\"\n          ]\n        ],\n        [\n          \"tr\",\n          [\n            \"td\",\n            \"128\"\n          ],\n          [\n            \"td\",\n            \"80\"\n          ],\n          [\n            \"td\",\n            \"...\"\n          ],\n          [\n            \"td\",\n            \"264\"\n          ]\n        ],\n        [\n          \"tr\",\n          [\n            \"td\",\n            \"...\"\n          ],\n          [\n            \"td\",\n            \"...\"\n          ],\n          [\n            \"td\"\n          ],\n          [\n            \"td\",\n            \"...\"\n          ]\n        ]\n      ]\n    ],\n    [\n      \"h4\",\n      \"2-2、构图的韵律\"\n    ],\n    [\n      \"p\",\n      \"在图标体系中，除了对重复出现的元素进行管理之外，我们还建议通盘的去考虑设计构图上的节奏感。\"\n    ],\n    [\n      \"ul\",\n      [\n        \"li\",\n        [\n          \"p\",\n          \"保持类似图标在构造上的一致性也是建立图标体系节奏感的一种方法。\"\n        ]\n      ]\n    ],\n    [\n      \"div\",\n      [\n        \"img\",\n        {\n          \"class\": \"preview-img no-padding\",\n          \"src\": \"https://gw.alipayobjects.com/zos/rmsportal/jpsoohmwvVgwSsblgPbc.png\",\n          \"alt\": \"节奏感\"\n        }\n      ]\n    ],\n    [\n      \"ul\",\n      [\n        \"li\",\n        [\n          \"p\",\n          \"此外，在单个图标的设计过程中，也建议适当理性的看待各元素间的比例关系，而非直觉式的开展绘制。\"\n        ]\n      ]\n    ],\n    [\n      \"div\",\n      [\n        \"img\",\n        {\n          \"class\": \"preview-img no-padding\",\n          \"src\": \"https://gw.alipayobjects.com/zos/rmsportal/XorcLWyrefyAmYagUpgY.png\",\n          \"alt\": \"元素间的比例关系\"\n        }\n      ]\n    ],\n    [\n      \"h3\",\n      \"3、平衡\"\n    ],\n    [\n      \"p\",\n      \"要保持整套图标在视觉重量上的平衡，是一件不太容易的事并且是一件需要大量实践的工作。图标的造型、线条摆放的角度甚至是留白空间等，都是会影响视觉平衡的因素，因此需要设计师适时的通过对基本元素规格上的微调来达到图标的平衡感。\"\n    ],\n    [\n      \"ul\",\n      [\n        \"li\",\n        [\n          \"p\",\n          [\n            \"strong\",\n            \"弯曲的线条会比竖直的线条看起来细\"\n          ],\n          \"。 因此在圆形的外边框上我们会适当的对 72px 的规格进行 4 px 的微调。\"\n        ],\n        [\n          \"div\",\n          [\n            \"img\",\n            {\n              \"class\": \"preview-img no-padding\",\n              \"src\": \"https://gw.alipayobjects.com/zos/rmsportal/GsrZFQbjQXwQoDRMnhKX.png\",\n              \"alt\": \"弯曲的线条会比竖直的线条看起来细\"\n            }\n          ]\n        ]\n      ],\n      [\n        \"li\",\n        [\n          \"p\",\n          [\n            \"strong\",\n            \"倾斜的线条也会比竖直的线条看起来细\"\n          ],\n          \"。 因此倾斜的线条也会进行 4 px 的微调。\"\n        ],\n        [\n          \"div\",\n          [\n            \"img\",\n            {\n              \"class\": \"preview-img no-padding\",\n              \"src\": \"https://gw.alipayobjects.com/zos/rmsportal/wfRqkxabWTKdQgiVSzKh.png\",\n              \"alt\": \"倾斜的线条也会比竖直的线条看起来细\"\n            }\n          ]\n        ]\n      ],\n      [\n        \"li\",\n        [\n          \"p\",\n          [\n            \"strong\",\n            \"图形的留白空间也是值得推敲的课题\"\n          ],\n          \"。 当某些图形的留白不足时，可以通过调节线条的粗细来达到视觉重量上的平衡。\"\n        ],\n        [\n          \"div\",\n          [\n            \"img\",\n            {\n              \"class\": \"preview-img no-padding\",\n              \"src\": \"https://gw.alipayobjects.com/zos/rmsportal/fVyyVdYqEXyjmxlWLtVw.png\",\n              \"alt\": \"图形的留白空间也是值得推敲的课题\"\n            }\n          ]\n        ]\n      ]\n    ],\n    [\n      \"h3\",\n      \"4、辨识\"\n    ],\n    [\n      \"p\",\n      \"辨识度是一套图标具备的可被感知的特色，通常和系统本身的品牌基因相关。Ant Design 的系统图标在这一次除了遵循\\\"确定\\\"和\\\"自然\\\"这两块价值观，在辨识度这一块也做了两处小尝试。\"\n    ],\n    [\n      \"ul\",\n      [\n        \"li\",\n        [\n          \"p\",\n          [\n            \"strong\",\n            \"让科技有温度：\"\n          ],\n          \" 通过对于图形圆角的定义，将过于圆润的圆角（72）调整至（32），在视觉效果上令图标看起来更为坚硬和理性（对应科技感），但又不至于太过尖锐（有温度）。\"\n        ]\n      ]\n    ],\n    [\n      \"div\",\n      [\n        \"img\",\n        {\n          \"class\": \"preview-img no-padding\",\n          \"src\": \"https://gw.alipayobjects.com/zos/rmsportal/aPRvNTmHNYxBoOeijhTM.png\",\n          \"alt\": \"让科技有温度\"\n        }\n      ]\n    ],\n    [\n      \"ul\",\n      [\n        \"li\",\n        [\n          \"p\",\n          [\n            \"strong\",\n            \"让图形有生命：\"\n          ],\n          \" 在部分图标设计中，会适度的注入拟人化的元素，令图标具备生命力。\"\n        ]\n      ]\n    ],\n    [\n      \"div\",\n      [\n        \"img\",\n        {\n          \"class\": \"preview-img no-padding\",\n          \"src\": \"https://gw.alipayobjects.com/zos/rmsportal/scJOuEdiwCgPONdiCZYZ.png\",\n          \"alt\": \"让图形有生命\"\n        }\n      ]\n    ],\n    [\n      \"h2\",\n      \"给设计师的一些建议\"\n    ],\n    [\n      \"p\",\n      \"在完成图标设计后，保持图形的整洁，图层结构的清晰，也是构筑图标体系必不可少的部分，Ant Design 对设计师有几点建议如下：\"\n    ],\n    [\n      \"ul\",\n      [\n        \"li\",\n        [\n          \"p\",\n          \"干掉多余的节点，保持图形的整洁。\"\n        ]\n      ]\n    ],\n    [\n      \"div\",\n      [\n        \"img\",\n        {\n          \"class\": \"preview-img no-padding\",\n          \"src\": \"https://gw.alipayobjects.com/zos/rmsportal/GTrZirSrsMIawXVjwoDI.png\",\n          \"alt\": \"保持图形的整洁\"\n        }\n      ]\n    ],\n    [\n      \"ul\",\n      [\n        \"li\",\n        [\n          \"p\",\n          \"合并图形，便于输出。\"\n        ]\n      ]\n    ],\n    [\n      \"div\",\n      [\n        \"img\",\n        {\n          \"class\": \"preview-img no-padding\",\n          \"src\": \"https://gw.alipayobjects.com/zos/rmsportal/CIKruspXHoWevGWpoXJO.png\",\n          \"alt\": \"合并图形\"\n        }\n      ]\n    ],\n    [\n      \"ul\",\n      [\n        \"li\",\n        [\n          \"p\",\n          \"对小数点以及奇数进行最后一遍的走查与修正。\"\n        ]\n      ]\n    ],\n    [\n      \"div\",\n      [\n        \"img\",\n        {\n          \"class\": \"preview-img no-padding\",\n          \"src\": \"https://gw.alipayobjects.com/zos/rmsportal/ySgIPVZBqPOWXOmTHTzT.png\",\n          \"alt\": \"走查与修正\"\n        }\n      ]\n    ],\n    [\n      \"ul\",\n      [\n        \"li\",\n        [\n          \"p\",\n          \"整洁的图层管理。\"\n        ]\n      ]\n    ],\n    [\n      \"div\",\n      [\n        \"img\",\n        {\n          \"class\": \"preview-img no-padding\",\n          \"src\": \"https://gw.alipayobjects.com/zos/rmsportal/zxExIlRfcDTAowrkesHD.png\",\n          \"alt\": \"图层管理\"\n        }\n      ]\n    ],\n    [\n      \"h2\",\n      \"写在最后\"\n    ],\n    [\n      \"p\",\n      \"图标的设计是 UI 设计中非常容易被忽略的环节，建立优秀的图形体系也不是一、二个设计人员的事，需要整个团队在设计前、设计中以及设计后都能够达成共识并且通力合作去完成共建。本次图标的升级，仅仅是一个开始。我们会建议在调用图标时，考虑具体业务对于图形化寄予的期望，以及用户操作时的心智模型等因素，结合实际情况做调用和适当的二次设计。\"\n    ]\n  ],\n  \"meta\": {\n    \"category\": \"全局样式\",\n    \"order\": 5,\n    \"title\": \"图标\",\n    \"filename\": \"docs/spec/icon.zh-CN.md\"\n  },\n  \"description\": [\n    \"section\",\n    [\n      \"p\",\n      \"图标是 UI 设计中必不可少的组成。通常我们理解图标设计的含义，是将某个概念转换成清晰易读的图形，从而降低用户的理解成本，提升界面的美观度。在我们的企业级应用设计范围中，图标在界面设计的诸多元素中往往只占了很小的比重，在调用时也会被缩到比设计稿小很多倍的尺寸，加上在图形素材极度丰富并且便于获取的今天，在产品设计体系中实现一套美观、一致、易用、便于延展的图标体系往往会被不小心忽略掉。Ant Design 相信一整套优质的图标对于设计质量的影响是非常巨大的，这考验着设计师的协作能力，以及对图形塑造的系统性思维，同时也能反映一个团队对于细节的追求。\"\n    ],\n    [\n      \"p\",\n      \"Ant Design 在\\\"确定\\\"和\\\"自然\\\"的设计价值观影响之下，对全套的基础系统图标进行了改造，现在大家可以在我们网站上直接查看并使用新版的图标，同时在这里将我们的系统性思路分享给大家，抛砖引玉，期待有更多的设计师参与到这个寂寞的微观世界中来，一起把图形设计这件事做好。\"\n    ],\n    [\n      \"p\",\n      [\n        \"a\",\n        {\n          \"title\": null,\n          \"href\": \"/components/icon/\"\n        },\n        \"查看图标库\"\n      ]\n    ]\n  ],\n  \"toc\": [\n    \"ul\",\n    [\n      \"li\",\n      [\n        \"a\",\n        {\n          \"className\": \"bisheng-toc-h2\",\n          \"href\": \"#设计师专属\",\n          \"title\": \"设计师专属\"\n        },\n        \"设计师专属\"\n      ]\n    ],\n    [\n      \"li\",\n      [\n        \"a\",\n        {\n          \"className\": \"bisheng-toc-h2\",\n          \"href\": \"#设计原则\",\n          \"title\": \"设计原则\"\n        },\n        \"设计原则\"\n      ]\n    ],\n    [\n      \"li\",\n      [\n        \"a\",\n        {\n          \"className\": \"bisheng-toc-h2\",\n          \"href\": \"#设计规格\",\n          \"title\": \"设计规格\"\n        },\n        \"设计规格\"\n      ]\n    ],\n    [\n      \"li\",\n      [\n        \"a\",\n        {\n          \"className\": \"bisheng-toc-h2\",\n          \"href\": \"#分层\",\n          \"title\": \"分层\"\n        },\n        \"分层\"\n      ]\n    ],\n    [\n      \"li\",\n      [\n        \"a\",\n        {\n          \"className\": \"bisheng-toc-h2\",\n          \"href\": \"#轮廓线与模版\",\n          \"title\": \"轮廓线与模版\"\n        },\n        \"轮廓线与模版\"\n      ]\n    ],\n    [\n      \"li\",\n      [\n        \"a\",\n        {\n          \"className\": \"bisheng-toc-h2\",\n          \"href\": \"#图标设计指引\",\n          \"title\": \"图标设计指引\"\n        },\n        \"图标设计指引\"\n      ]\n    ],\n    [\n      \"li\",\n      [\n        \"a\",\n        {\n          \"className\": \"bisheng-toc-h2\",\n          \"href\": \"#给设计师的一些建议\",\n          \"title\": \"给设计师的一些建议\"\n        },\n        \"给设计师的一些建议\"\n      ]\n    ],\n    [\n      \"li\",\n      [\n        \"a\",\n        {\n          \"className\": \"bisheng-toc-h2\",\n          \"href\": \"#写在最后\",\n          \"title\": \"写在最后\"\n        },\n        \"写在最后\"\n      ]\n    ]\n  ]\n};\n\n//# sourceURL=webpack:///./docs/spec/icon.zh-CN.md?./node_modules/bisheng/lib/loaders/source-loader.js");

